message: >-
  Dėl savotiško gyvulių ūkio žemės ūkio srityje kaip ir aišku. Jis egzistuoja
  gana ciniškoje formoje, kartu su individualiomis ir kitomis veiklomis, kurias
  vykdantys asmenys, matyt, yra lygesni už kitus šio ūkio gyventojus. O bet
  tačiau gal galėtumėte minėtas sumas pagrįsti skaičiavimais arba nurodyti
  šaltinį? Domina kilmė skaičių, kurių dar nesu matęs.
